    per iindiv tax credit per year for PAC donations.  None of the donations which
    Right to Life/Oregon PAC received in the 2008 January 31 Year End report were
    over $200 per iindiv & none accumulated to over $200 for the calendar year. Memo
    item on 12.22/08 for Accuzip belongs to check # 395 to Jane Groff for $500.50.
    All memo items for 12/31/08 belong to check # 399 for $13,229.51 to Oregon Right
    to Life for wages, payroll taxes, and payroll benefits.  12/39/2008 check for
    $51.62 to Oregon Rght to Life for bank charges is Right to Life Oregon PAC's portion
    of US bank customer analysis statement.  The check for $270.83 to Oregon Right
    to Life for printing, office supplies, & postage does not contain express advocacy."
